import {Header} from "../components"
import * as ROUTES from "../constants/routes"

export default function HeaderContainer({children}) {
  return (
    <Header >
      <Header.Frame>
        <Header.Logo/>
        <Header.ButtonLink to={ROUTES.SIGN_IN}>
          This is the button
        </Header.ButtonLink>
      </Header.Frame>
      {children}
    </Header>
  )
}
